import { Injectable } from '@angular/core';
import { Init } from './init-user';

@Injectable({
  providedIn: 'root'
})

export class UserService extends Init{

  constructor() { 
    super();
    this.load();
  }

  getCurrentUser() {
    let currentUser = JSON.parse(localStorage.getItem('currentUser'));
    return currentUser;
  }
}
